import React from 'react'
import Bugs from "../Components/Assets/images/Bugs.svg";
import Dependencies from "../Components/Assets/images/Dependencies.svg";
import CodeReview from "../Components/Assets/images/CodeReview.svg";
import UnitTesting from "../Components/Assets/images/UnitTesting.svg";
import Delay from "../Components/Assets/images/Delay.svg";
import ProjectCardData from './ProjectCardData';
const ProjectContain = () => {

    const card=[{
        logo:Bugs,
        count:0,
        name:"New Bugs"
    },
    {
        logo:Dependencies,
        count:0,
        name:"New Bugs"
    },
    {
        logo:CodeReview,
        count:0,
        name:"New Bugs"
    },
    {
        logo:UnitTesting,
        count:0,
        name:"New Bugs"
    },
    {
        logo:Delay,
        count:0,
        name:"New Bugs"
    },
]
  return (
    <div>
    <div className='ProjectCard-Contain'>
    {card && card.map((data)=>

        <ProjectCardData data={data}/>)}
        </div>
        </div>
  )
}

export default ProjectContain;
